# 324. wiggle sort II with dup
# when (i, j) equals can't swap, then find biggest from rest (k) and swap(j, k)
# worst case n^2
# better approach:
# find median, group all left to right or equal, fill begin odd position
# with right group, end even position with left group, fill rest with medians
# ways to find median: 
# 1. quick selection
# 2. bsearch with all ints (CONST), then check if it's median O(n)
class Solution(object):
    def wiggleSort(self, nums):
        """
        :type nums: List[int]
        :rtype: void Do not return anything, modify nums in-place instead.
        """
        def swap(i, j):
            a = nums[j]
            nums[j] = nums[i]
            nums[i] = a
            # nums[i], nums[j] = nums[j], nums[i]

        def findNext(offset, toggle):
            index = offset
            for i in xrange(offset, len(nums)):
                if nums[index]*toggle > nums[i]*toggle:
                    index = i
            return index

        odd = True
        for i in xrange(1, len(nums)):
            if nums[i] == nums[i-1]:
                if odd: swap(i, findNext(i, 1)) # biggest
                else:   swap(i, findNext(i, -1)) # smallest
                
            elif odd ^ (nums[i] > nums[i-1]):
                swap(i, i-1)

            odd = not odd

        return nums


